import React from "react";

const Start = () => {
  return (
    <>
      <div className="flex flex-col justify-center items-center w-auto p-28">
        <div className="flex items-center">
          <h1 className="text-4xl font-semibold mb-5 mt-14 mr-2">Welcome</h1>
          <img src="Logo.png" className="w-8 h-8 mt-16 mr-4" alt="Image" />
        </div>

        <div className="flex">
          <button className="relative inline-flex items-center justify-center p-0.5 mb-2 me-2 overflow-hidden text-sm font-medium text-gray-900 rounded-lg group bg-gradient-to-br from-cyan-500 to-blue-500 hover:bg-opacity-100 hover:text-white dark:text-white focus:ring-4 focus:outline-none focus:ring-cyan-200 dark:focus:ring-cyan-800">
            <span className="relative px-5 py-2.5 transition-all ease-in duration-75 bg-white dark:bg-gray-900 rounded-md group-hover:bg-opacity-0">
              User
            </span>
          </button>
          <button className="relative inline-flex items-center justify-center p-0.5 mb-2 me-2 overflow-hidden text-sm font-medium text-gray-900 rounded-lg group bg-gradient-to-br from-cyan-500 to-blue-500 hover:bg-opacity-100 hover:text-white dark:text-white focus:ring-4 focus:outline-none focus:ring-cyan-200 dark:focus:ring-cyan-800">
            <span className="relative px-5 py-2.5 transition-all ease-in duration-75 bg-white dark:bg-gray-900 rounded-md group-hover:bg-opacity-0">
              Manager
            </span>
          </button>
        </div>
      </div>
    </>
  );
};

export default Start;
